import React, { Component } from 'react'

export default class logo extends Component {
    constructor(props){
        super(props);
        this.state = {
            logoFile: this.props.filename,
        }
    }
    render() {
        return (
            <img src = './logo.svg' alt='React logo' className = 'App-logo'/>
        )
    }
}
